import logo from "./logo.svg";
import Navbar from "./Navbar";
import Home from "./Home";
import Login from "./Login";
import Signup from "./Signup";
import About from "./About";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  /*const title = "Helvetica Neue";
  const likes = 50;
  const person = { name: "karen", age: 19 };
  const link = "http://www.google.com";*/

  return (
    <Router>
      <Switch>
        <Route path="/Home">
          <Navbar />
          <Home />
        </Route>
        <Route path="/Login">
          <Login />
        </Route>
        <Route path="/Signup">
          <Signup />
        </Route>
        <Route path="/About">
          <About />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
